import { BrowserRouter, Routes, Route } from "react-router-dom";
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar1 from './Components/Navbar1';
import Home from "./Components/Home";


function App() {
  return (
    <div className="App">
      <Route index element={<Home />} />
      <BrowserRouter>
      <Routes>
      <Route index element={<Home />} />
      </Routes>
      </BrowserRouter>
      </div>
  );
}

export default App;
